import React from 'react';

import AuthPage from '../../../authPage/components/AuthPage';

const RegisterPage = () => {
  const lineItems = [
    'The first explanation about scientist',
    'The second explanation about scientist',
    'The third explanation about scientist',
  ];
  const signupHeadline = 'Move Science Forward';

  return (
    <AuthPage
      lineItems={lineItems}
      signupHeadline={signupHeadline}
      isLogin={false}
      isScientist
      switchLink={'/login'}
    />
  )
}

export default RegisterPage;
